import React from 'react'
import "./Home.css"

function Home() {
  return (
    <div className='home'>
        <div className='home__container'> 
            <img src='https://images-eu.ssl-images-amazon.com/images/G' alt='' className='home__image'/>
        </div>
    </div>
  )
}

export default Home
